changeSet.createProcedure:
CREATE PROCEDURE `proc_ec_christmas_active`()
BEGIN
DECLARE _sumdeposit DOUBLE;
DECLARE _nickname VARCHAR(255);
DECLARE _createtime DATETIME;
DECLARE _mobileNumber VARCHAR(20);
DECLARE fetchSeqOk BOOLEAN;
DECLARE cur1 CURSOR FOR SELECT *
FROM ec_christmas_active_view ;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET
fetchSeqOk = TRUE;
DELETE FROM  ec_christmas_active  WHERE ADDTIME>=CURDATE();
SET fetchSeqOk = FALSE;
OPEN cur1;
fetchSeqLoop:LOOP
FETCH cur1 INTO
_sumdeposit,_nickname,_mobileNumber,_createtime;
IF fetchSeqOk THEN
LEAVE
fetchSeqLoop;
ELSE
INSERT INTO ec_christmas_active(sumdeposit,nickname,createtime,id,ADDTIME,mobileNumber) VALUES
(_sumdeposit,_nickname,_createtime,UUID(),NOW(),_mobileNumber);
END IF;
END LOOP;
CLOSE cur1;
end

CREATE PROCEDURE `proc_ec_christmas_invite_user`()
BEGIN
  DECLARE _invitenum INT;
DECLARE _nickname VARCHAR(255);
DECLARE _createtime DATETIME;
DECLARE _mobileNumber VARCHAR(20);
DECLARE fetchSeqOk BOOLEAN;
DECLARE cur1 CURSOR FOR SELECT *
FROM  ec_christmas_active_inviteuser_view ;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET
fetchSeqOk = TRUE;
TRUNCATE ec_christmas_active_invite;
SET fetchSeqOk = FALSE;
OPEN cur1;
fetchSeqLoop:LOOP
FETCH cur1 INTO
_invitenum,_createtime,_nickname,_mobileNumber;
IF fetchSeqOk THEN
LEAVE
fetchSeqLoop;
ELSE
INSERT INTO ec_christmas_active_invite(invitenum,nickname,id,createtime,ADDTIME,mobileNumber) VALUES
(_invitenum,_nickname,UUID(),_createtime,NOW(),_mobileNumber);
END IF;
END LOOP;
CLOSE cur1;
end


CREATE PROCEDURE `proc_add_prize_by_maxtask`()
BEGIN
 DECLARE _mobileNumber VARCHAR(20);
DECLARE _createtime DATETIME;
DECLARE fetchSeqOk BOOLEAN;
DECLARE cur1 CURSOR FOR SELECT createtime, mobileNumber FROM ec_christmas_active WHERE createtime>=CURDATE() - INTERVAL 1 DAY AND createtime<CURDATE() ORDER BY sumdeposit DESC ,createtime LIMIT 1;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET
fetchSeqOk = TRUE;
DELETE FROM  ec_prize_detail  WHERE createtime>=DATE_FORMAT(DATE_SUB(NOW(),INTERVAL 1 DAY),'%Y-%m-%d') AND dotype=2; 
SET fetchSeqOk = FALSE;
OPEN cur1;
fetchSeqLoop:LOOP
FETCH cur1 INTO
_createtime,_mobileNumber;
IF fetchSeqOk THEN
LEAVE
fetchSeqLoop;
ELSE
INSERT INTO ec_prize_detail(mobilenumber,id,prizename,createtime,dotype) VALUES
(_mobileNumber,UUID(),'红米手机一部',DATE_FORMAT(DATE_SUB(NOW(),INTERVAL 1 DAY),'%Y-%m-%d'),2);
END IF;
END LOOP;
CLOSE cur1;
end


CREATE PROCEDURE `proc_add_prize_by_inviteuser`()
BEGIN
     DECLARE _mobileNumber VARCHAR(20);
DECLARE _createtime DATETIME;
DECLARE fetchSeqOk BOOLEAN;
DECLARE cur1 CURSOR FOR SELECT createtime, mobileNumber FROM ec_christmas_active_invite WHERE createtime>='2013-12-25' AND createtime<'2014-01-02' ORDER BY invitenum DESC ,createtime LIMIT 1;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET
fetchSeqOk = TRUE;
DELETE FROM  ec_prize_detail  WHERE createtime>=CURDATE() AND dotype=4; 
SET fetchSeqOk = FALSE;
OPEN cur1;
fetchSeqLoop:LOOP
FETCH cur1 INTO
_createtime,_mobileNumber;
IF fetchSeqOk THEN
LEAVE
fetchSeqLoop;
ELSE
INSERT INTO ec_prize_detail(mobilenumber,id,prizename,createtime,dotype) VALUES
(_mobileNumber,UUID(),'iPad mini一部',NOW(),4);
END IF;
END LOOP;
CLOSE cur1;
end

CREATE EVENT `christmas_active_event` ON SCHEDULE EVERY
30 MINUTE STARTS '2013-12-25 00:00:00' ENDS '2014-01-02 00:00:00' ON COMPLETION NOT PRESERVE
ENABLE DO call proc_ec_christmas_active();

CREATE EVENT `christmas_invite_event` ON SCHEDULE EVERY
60 MINUTE STARTS '2013-12-25 00:00:00' ENDS '2014-01-02 02:00:00' ON COMPLETION NOT PRESERVE
ENABLE DO call proc_ec_christmas_invite_user();

CREATE EVENT `christmas_add_prize_event` ON SCHEDULE EVERY
1 DAY STARTS '2013-12-26 01:00:00' ENDS '2014-01-02 01:00:00' ON COMPLETION NOT PRESERVE
ENABLE DO call proc_add_prize_by_maxtask();

CREATE EVENT `christmas_insert_prize_invite_event` ON SCHEDULE EVERY
2 HOUR STARTS '2014-01-02 01:00:00' ENDS '2014-01-02 02:00:00' ON COMPLETION NOT PRESERVE
ENABLE DO call proc_add_prize_by_inviteuser();
